import styled from 'styled-components';

export const Container = styled.section`
    margin: 0px auto;
    width: 960px;
    border: 1px solid red;
    width-max: 960px;
`;

export const Header = styled.header`
    background-color: #FAD70A;
    height: 70px;
`;

export const Menu = styled.nav`
    background-color: #;
    height: 50px;
`;
